import {useState} from "react";
import "./App.css";

function App() {
  const [patienter, setPatienter] = useState([
    {id: 12345, plats: "101", datum: "23-09-30", fvk: "LEB"},
    {id: 67890, plats: "111", datum: "23-10-10", fvk: "MD"},
  ]);
  //  state för ny patient - start in = input
  const [inPlats, setInPlats] = useState("");
  const [inDatum, setInDatum] = useState("");
  const [inKontakt, setInKontakt] = useState("");

  //  state för redigering
  const [redigeradPatient, setRedigeradPatient] = useState("");

  //funktioner som ska vara i appen
  function deletePatient(id) {
    setPatienter((nuvPatienter) => {
      return nuvPatienter.filter((p) => p.id !== id);
    });
  }

  function handleSubmit(e) {
    e.preventDefault();
    const nyPatient = {
      id: new Date().getTime(),
      plats: inPlats,
      datum: inDatum,
      fvk: inKontakt,
    };
    setPatienter((currentP) => {
      return [...currentP, nyPatient];
    });
  }

  function changeData(e) {
    const editedPatient = {
      id: redigeradPatient.id,
      datum: redigeradPatient.datum,
      plats: e.target.value,
      fvk: e.target.value,
    };
    setRedigeradPatient(editedPatient);
  }
  return (
    <div className="App">
      <h1>Teest</h1>
      <br />
      {/* //redigera formulär */}
      <div className="card">
        <form onSubmit={handleSubmit}>
          <div className="form-container">
            <div className="va-container">
              <input
                type="text"
                value={redigeradPatient && redigeradPatient.plats}
                onChange={(e) => changeData(e)}
              />
              <input
                type="text"
                value={redigeradPatient && redigeradPatient.fvk}
                onChange={(e) => changeData(e)}
              />
              <input />
            </div>
            <div className="ho-container">
              <input
                type="date"
                value={redigeradPatient && redigeradPatient.datum}
              />
              <input />
              <input />
            </div>
          </div>
          <div className="btn-container">
            <button>Uppdatera</button>
          </div>
        </form>
      </div>
      <br />
      {/* ny patient form - start */}
      <div className="card">
        <form onSubmit={handleSubmit}>
          <div className="form-container">
            <div className="va-container">
              <input
                type="text"
                value={inPlats}
                onChange={(e) => setInPlats(e.target.value)}
              />
              <input
                type="text"
                value={inKontakt}
                onChange={(e) => setInKontakt(e.target.value)}
              />
              <input />
            </div>
            <div className="ho-container">
              <input
                type="date"
                value={inDatum}
                onChange={(e) => setInDatum(e.target.value)}
              />
              <input />
              <input />
            </div>
          </div>
          <div className="btn-container">
            <button>Spara</button>
          </div>
        </form>
      </div>

      {/* tabell av patienter */}
      <table className="table">
        <thead>
          <tr>
            <th>Plats</th>
            <th>Datum</th>
            <th>FVK</th>
          </tr>
        </thead>
        <tbody>
          {patienter.map((p) => {
            return (
              <tr key={p.id}>
                <td>{p.plats}</td>
                <td>{p.datum}</td>
                <td>{p.fvk}</td>
                <td>
                  <button
                    className="btn-edit"
                    onClick={() =>
                      setRedigeradPatient({
                        id: p.id,
                        plats: p.plats,
                        datum: p.datum,
                        fvk: p.fvk,
                      })
                    }
                  >
                    Redigera
                  </button>
                </td>
                <td>
                  <button
                    className="btn-delete"
                    onClick={() => deletePatient(p.id)}
                  >
                    X
                  </button>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}

export default App;
